		08FB7794FE84155DC02AAC07 /* Libm */ = {
			isa = PBXGroup;
			children = (
				3BFD533E0AB73E29005DA5F1 /* Headers */,
				08FB7795FE84155DC02AAC07 /* Source */,
				3BFD54330AB75146005DA5F1 /* Exports and Alias Files */,
				3BFD5AA30AB80434005DA5F1 /* Man pages */,
				1AB674ADFE9D54B511CA2CBB /* Products */,
			);
			comments = "\nComments on User defined build settings:\n==========================\nALIAS_LIST = $(ALIAS_LIST_$(IS_THIS_OS_TIGER))\nALIAS_LIST_ = $(ALIAS_LIST_PER_ARCH_$(CURRENT_ARCH))\nALIAS_LIST_PER_ARCH_i386 = \nALIAS_LIST_PER_ARCH_x86_64 = \n\n\tThese are used to set up the -alias_list flag for the $fenv_access_off symbols.  We use IS_THIS_OS_TIGER to prevent the symbols from being used\n\ton Tiger.  The feature is also Intel only, so we only define the ALIAS_LIST_PER_ARCH for those architectures.  Later targets will supply their own \n\tvalues for ALIAS_LIST_PER_ARCH_i386 and ALIAS_LIST_PER_ARCH_x86_64.\n\n\nEXCLUDED_SOURCE_FILE_NAMES = Source/*/*.c Source/*/*.s Source/*/*/*.c Source/*/*/*.s\nINCLUDED_SOURCE_FILE_NAMES = $(PER_ARCH_SRCROOT)/*.c $(PER_ARCH_SRCROOT)/*.s $(PER_ARCH_SRCROOT)/$(CURRENT_ARCH)/*.c $(PER_ARCH_SRCROOT)/$(CURRENT_ARCH)/*.s\nPER_ARCH_SRCROOT = $(PER_ARCH_SRCROOT_$(CURRENT_ARCH))\nPER_ARCH_SRCROOT_i386 = $(SRCROOT)/Source/Intel\nPER_ARCH_SRCROOT_ppc = $(SRCROOT)/Source/PowerPC\nPER_ARCH_SRCROOT_ppc64 = $(SRCROOT)/Source/PowerPC\nPER_ARCH_SRCROOT_x86_64 = $(SRCROOT)/Source/Intel\n\n\n\tUsed to provide arch-specific compilation on a per-file basis.  File placement in the Source/ directory determines which archs\n\tthe source will be compiled for. See <rdar://problem/4722680> for more details.  This build method requires Xcode 2.3 or later. \n\n\n\t9/7/06 4:20 PM Chris Espinosa:\n\tNote that there is a mechanism in Xcode 2.3 and later that does a limited subset of this:\n\tThe feature is actually implemented, but undocumented, in Xcode 2.3 and later:\n\n\tINCLUDED_SOURCE_FILE_NAMES and EXCLUDED_SOURCE_FILE_NAMES\n\n\tNote that each entry in each setting can actually be a path suffix (not just a file name), so I can for example say\n\n\tEXCLUDED_SOURCE_FILE_NAMES = ArchSpecific/*/*.c\n\tINCLUDED_SOURCE_FILE_NAMES = ArchSpecific/$(CURRENT_ARCH)/*.c\n\n\tIn other words, there's an implicit \"/**/\" at the front of each pattern.\n\n\tFor each file considered for processing, the patterns in EXCLUDED_SOURCE_FILE_NAMES are first tested.  If there's a match, then the file is skipped, unless there is -also- a match in \tINCLUDED_SOURCE_FILE_NAMES.  Typical usage is that EXCLUDED_SOURCE_FILE_NAMES is set to filter all the files of a particular kind, and then INCLUDED_SOURCE_FILE_NAMES is used \n\tto include a smaller set of files based on the current arch / platform / whatever.\n\n\n\nLIBM_VERSION = 220\n\n\tUsed to set the dyld current version for the library. This should in general be kept in sync with the submission number. For example, for Libm-227, set to 227.\n\n\nPER_ARCH_CFLAGS_i386 = $(USE_SSE3)\nPER_ARCH_CFLAGS_ppc = -fdollars-in-identifiers  -mtune=970 -force_cpusubtype_ALL -fsched-interblock -falign-loops=16 -falign-jumps=16 -falign-functions=16 -falign-jumps-max-skip=15 -falign-loops-max-skip=15 -malign-natural\nPER_ARCH_CFLAGS_ppc64 = $(PER_ARCH_CFLAGS_ppc) -mcpu=970 -Wshorten-64-to-32\nPER_ARCH_CFLAGS_x86_64 = -Wshorten-64-to-32 -msse3 -mmni\n\n\tFlags set during compilation on a per-architecture basis for all files.\n\n\nPER_ARCH_HEADER_PATH = $(PUBLIC_HEADERS_FOLDER_PATH_$(CURRENT_ARCH))\nPER_ARCH_HEADER_PATH_i386 = architecture/i386\nPER_ARCH_HEADER_PATH_ppc = architecture/ppc\nPER_ARCH_HEADER_PATH_ppc64 = architecture/ppc\nPER_ARCH_HEADER_PATH_x86_64 = architecture/i386\n\n\tWhere to put/find the arch-specific math.h and fenv.h headers. \n\n\nRC_XBS_YES_RC_FORCE_SSE3_ = -march=pentium-m -mno-sse3\nRC_XBS_YES_RC_FORCE_SSE3_YES = -msse3\nRC_XBS__RC_FORCE_SSE3_ = -msse3\nRC_XBS__RC_FORCE_SSE3_YES = -msse3\nUSE_SSE3 = $(RC_XBS_$(RC_XBS)_RC_FORCE_SSE3_$(RC_FORCE_SSE3))\n\n\tB&I needs to be able to externally control whether we use SSE3 for i386 builds or not, using the RC_XBS and RC_FORCE_SSE3 environment variables. \n\tIf RC_XBS is defined to YES, but RC_FORCE_SSE3 is undefined, then we need to build without SSE3. Otherwise, we can build with SSE3.\n\n\n\n\nOther Comments\n===========\nSome of the build targets have their own target specific comments attached to them. \n\nThere are some weird inconsistencies:\n\n\tThere is no libmCommon_profile.a.   We only make the dylib version.\n\n\tlibmCommon_static.a also doesn't exist. The symbols that would have been in it are merged into libm_static.a.\n\n\tWhile libm.a and libm_static.a are both static libraries, libm_static.a is also -static in the gcc sense.  It is built without \n\tPIC code.\n\n\tTechnically, we should be exporting our global data symbols (e.g. signgam) as partially defined in the common section.\n\tThis is so someone can declare their own signgam and not get an error. We have never done that and the error has been\n\tpropagated here, because it simplifies the build.  The problem is described in <rdar://problem/4637139>.  We use the \n\t-d linker flag to move the symbols to be defined. We could probably also do this with -fno-common on the appropriate\n\tC files, but there is a libtool crasher. <rdar://problem/4739572>  The real solution is to break up the various libm.a builds\n\tinto two steps. Make the .o file and apply the exports file, then in a second build target take that build product, link a \n\tsigngam.c (which contains only the definition for signgam) and link it to that and make the .a. \n\n\tWe set -std=gnu99.  If we don't do that, some of the long long using interfaces in math.h don't get declared.  (long long is\n\tnot a feature of C90.) This causes their symbol to be wrong on PowerPC due to the long double 64/128. Both versions end\n\tup being named like the 64-bit long double version and we get a link error. \n\nThis build system supports building with and without SSE3.  By default SSE3 is on.  However, if you define RC_XBS to be YES and \nleave RC_FORCE_SSE3 undefined, it will build with SSE3 off. When you specify -release [train_name] with ~rc/bin/buildit, the tools \nwill set these environment variables appropriately for that train.\n\nLink flags should be in general like this:\n\n\t .o files:   -nostdlib -r\n\t .dylib:      -nodefaultlibs\n \t.a fles:      (-d) -nostdlib -r\n\n\nA partial list of requirements for what the headers need to satisfy:\n\n\tmust work with major compilers:  xlc, MWCW, gcc, &c\n\tmust work even when code compiling on today's OS needs to run on a much older OS like MacOS X.3\n\t\tFor example, using the X.5 SDK, but  passing -mmacosx-version-min=10.3\n\t\tSo, for example the header should invoke new symbols only when it is sure they exist on the old OS\n\tMay not define new C preprocessor symbols per Unix2003, except when they are prepended with __, or explicitly required by C99. \n\t\t(The exception for FE_ symbols provided by C99 may or may not be allowed by Unix2003)\n\tMust also work with C++, ObjC\n\t\n/usr/bin/libmx.dylib, /usr/bin/libmx_debug.dylib and /usr/bin/libmx_profile.dylib are not links to the .A.dylib version like the other \ndylibs are. They are stub libraries that either contain nothing (all other archs) or a copy of the MacOS X.3.9 SDK /usr/lib/libmx.A(libstyle).dylib\n(ppc).  This must be so, because some symbols moved from libmx to libSystem. If we don't make a stub library, then people linking against\nlibmx on MacOS X.4 or later, may end up getting the symbols from libSystem instead of libmx. This will cause them not to load on X.3. \n<rdar://problem/4904641>\n\n";
			name = Libm;
			sourceTree = "<group>";
		};
